import React, { Component } from 'react';

const events = require("../countdown-list.json");

let date = new Date();

let day = events[0];

let event = new Date(`${day.month}/${day.day}/${day.year}`);

export default class Countdown extends Component {
    constructor(props) {
        super(props)
        this.state = {
            timeLeft: ''
        }
    }

    render() {
        console.log(date, day, event);
        return (
            <div>
                {events.map(event => 
                    <div key={event.id}>
                        <h1>{event.title}</h1>
                        <h2>{event.month}/{event.day}/{event.year}</h2>
                    </div>
                )}
            </div>
        )
    }
}
